import React, { useEffect, useState } from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import LikedGamesPage from './components/LikedGames';
import Login from './components/Login';
import { Auth0Provider } from '@auth0/auth0-react';

function Index() {
  const auth0Config = {
    domain: 'YOUR_AUTH0_DOMAIN',
    clientID: 'YOUR-AUTH0_CLIENT_ID',
    redirectUri: window.location.origin,
  };
  const [likedGames, setLikedGames] = useState([]);
  const [setShowLikedGamesPage] = useState(false);

  const handleLikedGamesClose = () => {
    setShowLikedGamesPage(false);
  };

  useEffect(() => {
    const checkLogin = async () => {
      const { isAuthenticated } = await auth0Config;
      if (isAuthenticated) {
        Navigate('/');
      }
    };
    checkLogin();
  }, []);

  return (
    <React.StrictMode>
    <Router>
      <Auth0Provider {...auth0Config}>
        <Routes>
          <Route exact path="/" element={<App likedGames={likedGames} setLikedGames={setLikedGames} setShowLikedGamesPage={handleLikedGamesClose} />} />
          <Route path="/login" element={<Login />} />
          <Route path='/liked-games' element={<LikedGamesPage likedGames={likedGames} panelItems={['Liked Games']} onClose={handleLikedGamesClose} />} />
        </Routes>
      </Auth0Provider>
    </Router>
  </React.StrictMode>
  );
}
const root = document.getElementById('root');
ReactDOM.createRoot(root).render(<Index />);
